import React from 'react'
import Signinbtn from '../SignIn-Btn/Signinbtn'
import "./Navbar.css"
const Navbar = (props) => {
    const user = props.user
    console.log("AMER " + user)
    return (
       <nav className='navbar'>
           <h3>React Social</h3>
           {user ? 'hello' : <Signinbtn props={props} />}
       </nav>
    )
}

export default Navbar
